أرتبط مفهوم الذكاء بالعمليات العقلية المتعلقة بالذاكرة والمعرفة والإدراك والطلاقة والاستدلال والقدرة العددية والانتباه، وكانت أفكار(جاردنر) ترفض فكرة أن الإنسان يمتلك ذكاء واحداً، بل ذكاءات مستقلة، يشغل كل منها حيزاً معيناً في دماغه

